xt color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Anime seu dia com as desventuras monocromáticas da Turma do Tinteiro!</>\r\n\r\nO pacote inclui:"),("ru","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Приготовьтесь наблюдать за увлекательными злоключениями этой мультяшной банды!</>\r\n\r\nНабор содержит:"),("tr","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Mürekkep Tayfası'nın siyah beyaz ve talihsiz maceralarına tanıklık et!</>\r\n\r\nPaket şunları içerir:")))
