+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="4092B35440FFCCE3F6AA93AC47B3D7EF", NativeString="TBD_Blurb of text to learn more", LocalizedStrings=(("ar","تتعهد Epic بالتبرّع بعائدات Fortnite في الفترة من 20 مارس 2022 حتى 3 أبريل 2022 للمساعدات الإنسانية للمتضررين من الحرب في أوكرانيا. \r\n\r\nاكتشف المزيد على fn.gg/ukraine"),("en","Epic is committing all its Fortnite proceeds from March 20, 2022 through April 3, 2022 to humanitarian relief for people affected by the war in Ukraine. \r\n\r\nLearn more at fn.gg/ukraine"),("de","Epic wird alle zwischen dem 20. März 2022 und dem 3. April 2022 mit Fortnite erzielten Einnahmen humanitären Hilfsprojekten für Menschen zukommen lassen, die vom Krieg in der Ukraine betroffen sind. \r\n\r\nWeitere Informationen unter: fn.gg/ukraine."),("es","Epic destinará todas las ganancias de Fortnite correspondientes al periodo entre el 20 de marzo de 2022 y el 3 de abril de 2022 como ayuda humanitaria para aquellas personas afectadas por la guerra en Ucrania.\r\n\r\nMás información en fn.gg/ukraine"),("es-419","Epic va a destinar todas las ganancias de Fortnite obtenidas del 20 de marzo de 2022 al 3 de abril de 2022 como ayuda humanitaria a las personas afectadas por la guerra en Ucrania.\r\n\r\nMás información en fn.gg/ukraine"),("fr","Epic s'engage à verser tous ses bénéfices de Fortnite entre le 20 mars et le 3 avril 2022 à l'aide humanitaire à destination des victimes de la guerre en Ukraine. \r\n\r\nPour en savoir plus, rendez-vous sur fn.gg/ukraine."),("it","Epic si impegna a devolvere i ricavi totali di Fortnite dal 20 marzo 2022 al 3 aprile 2022 ai soccorsi umanitari per la popolazione colpita dalla guerra in Ucraina. \r\n\r\nScopri di più su fn.gg/ukraine."),("ja","Epicは、2022年3月20日から2022年4月3日までのフォートナイトにおける収益の全てを、ウクライナでの戦争によって影響を受けた人々への人道支援のために寄付いたします。\r\n\r\n詳細はこちら: fn.gg/ukraine"),("ko","에픽은 2022년 3월 20일부터 2022년 4월 3일까지의 포트나이트 수익 전액을 우크라이나 전쟁으로 피해를 입은 사람들을 위한 인도적 구호에 사용합니다. \r\n\r\n자세히 보기: fn.gg/ukraine"),("pl","Epic przeznacza wszystkie wpływy z Fortnite z okresu od 20 marca 2022 do 3 kwietnia 2022 na pomoc humanitarną dla osób dotkniętych wojną w Ukrainie.\r\n\r\nDowiedz się więcej na fn.gg/ukraine"),("pt-BR","A Epic reverterá toda a receita do Fortnite, no período de 20 de março de 2022 a 3 de abril de 2022, em ajuda humanitária aos afetados pela guerra na Ucrânia. \r\n\r\nSaiba mais em fn.gg/ukraine"),("ru","Epic направит весь доход, который принесёт Fortnite с 20 марта 2022 года по 3 апреля 2022 года, в виде гуманитарной помощи людям, пострадавшим в результате войны в Украине."),("tr","Epic, 20 Mart 2022'den 3 Nisan 2022'ye kadar elde ettiği tüm Fortnite gelirini, Ukrayna'daki savaştan etkilenenler için insani yardıma adıyor. \r\n\r\nDaha fazla bilgi için: fn.gg/ukraine.")))
